7 vegan eats in Copenhagen that are a must! 

Copenhagen was a city that really blew me away and I had such a great friend who was the best host to show me around!

Try a flødeboller. A Danish chocolate covered marshmallow treat. I found a vegan version at @kihoskh 
@bistroverdecph an all vegan restaurant in the popular  Nørrebro neighborhood
@nicecream an all vegan ice cream shop
@cafe_kaf an all vegan cafe with the best pastries! A Danish Kringle is a must!
@simplychocolatecph is a Danish chocolate brand and the Salty Fred is their vegan chocolate. Delicious!
@moomooisbar is an all vegan gelato spot that had the best pistachio gelato of my life. They even have waffle cones!
@reffen_copenhagenstreetfood is a massive street food venue with loads of carts to choose from right on the harbor. 

